description:
Jelena is a prominent Toronto entrepreneur/feminist/witch and simply has no time to take care of simple house chores after all her extra curricular activities. On a warm July day she decides enough is enough. After stepping in cat poo she neglected to clean over a week ago Jelena succumbs and decides to hire a cleaner. Unbeknownst to Jelena, her cleaner for the day would be sexy Nicaraguan Ray Bans. The second Ray Bans opens the door to his job that day, he is greeted by the voluptuous fiery vixen. It was love at first clean, and Ray Bans starts with the back door and works his way through. Two hearts collide in a youthful duet of anal love.

